import { fetchEnglishLeagueTable } from "../actions/ActionTypes";
const initialState = {
  EnglishTable: {}
};

const rootReducer = (state = initialState, action) => {
  switch (action.type) {
    case fetchEnglishLeagueTable:
      return [...state, { EnglishTable: action.payload }];
    default:
      return state;
  }
};

export default rootReducer;
